import React from "react";
import { Link } from "react-router-dom";

const Button = ({ response, text, onClick }) => {
  return (
    <>
      {response ? (
        <Link to="/necas">
          <button className="Button" onClick={onClick}>
            {text}
          </button>
        </Link>
      ) : (
        alert("Bro")
      )}
    </>
  );
};

Button.defaultProps = {
  text: "Submit",
};
export default Button;
